import React from "react";
import Header from "./Header";


function AddExpense(){
    return (
    <div>
        <Header />
        <h1>Add Expense</h1>
        <input type='text' name="subject" placeholder="Name of Expense"></input>
        <input type='number' name="subject"></input>
    </div>)
}

export default AddExpense;
